def cosineSimilarity(query):
    ps = PorterStemmer()
    terms,documentVectors = vsmCalculatorFinalData()
    alpha = 0.025
    queryVector = [0] * len(terms)
    for term in query.split():
        if ps.stem(term) in terms:
            queryVector[terms.index(ps.stem(term))] += 1
    # print("queryVector",queryVector)
    similarities = {}
    queryNorm = math.sqrt(sum(x**2 for x in queryVector))
    # print(queryNorm)
    for doc_id,docVector in documentVectors.items():
        # print(docVector)
        dotProduct = sum(i*j for i, j in zip(queryVector, docVector))
        docNorm = math.sqrt(sum(x**2 for x in docVector))
        # print(doc_id,"dotProduct",dotProduct, "docNorm", docNorm)
        similarity = dotProduct / (queryNorm * docNorm) if queryNorm > 0 else 0.0
        similarities[doc_id] = similarity if similarity >= alpha else 0.0
    similarities = dict(sorted(similarities.items(), key=lambda x:x[1], reverse=True))
    return similarities

def index(request):
    if request.method=="POST":
        query = request.POST.get('query')
        print(query)
        similarities = cosineSimilarity(query)
        print(similarities)
        documentArray = [keys for keys, value in similarities.items() if value>0]
        # print("Similarities with the query:\n", similarities)
        return render(request,'index.html', {'query':query,'docArr':documentArray})
    else:
        return render(request,'index.html')
